/*

@import url("https://fonts.googleapis.com/css?family=Poppins:300,400,500,600,700,900");

@mixin fluid-type($min-font-size: 18px, $max-font-size: 32px, $lower-range: 499px, $upper-range: 1160px) {
  font-size: calc(
    #{$min-font-size} + #{(
        ($max-font-size / ($max-font-size * 0 + 1)) - ($min-font-size / ($min-font-size *
                  0 + 1))
      )} *
      (
         (100vw - #{$lower-range}) / #{(
            ($upper-range / ($upper-range * 0 + 1)) - ($lower-range / ($lower-range *
                      0 + 1))
          )}
      )
  );

  @media screen and (max-width: $lower-range) {
    font-size: $min-font-size;
  }
  @media screen and (min-width: $upper-range) {
    font-size: $max-font-size;
  }
}

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}
body {
  width: 100%;
  height: 100vh;
  font-family: poppins;
}
.hero {
  width: 100%;
  height: 100vh;
  min-height: 1000px;
  position: relative;
  background-image: url(https://images.unsplash.com/photo-1501676491272-7bbd3e71f7e1?ixlib=rb-0.3.5&ixid=eyJhcHBfaWQiOjEyMDd9&s=687a32748561c1902aca06a66f247776&auto=format&fit=crop&w=1500&q=90);
  background-size: cover;

  background-position: center;

  // &:after{
  //   width:100%;
  //   position:absolute;
  //   top:0;
  //   left:0;
  //   height:100%;
  //   background:rgba(50,50,50,0.4);
  //   content:'';
  // }
}
.hero-box-container {
  display: flex;
  align-items: center;
  justify-content: center;
  position: absolute;
  bottom: 0;
  width: 100%;
  z-index: 2;
}
.hero-box {
  flex-basis: 33.3%;
  background: rgb(240, 240, 240);
  min-height: 300px;
  padding: 60px 30px;
  display: flex;
  justify-content: space-between;
  flex-direction: column;
  text-decoration: none;
  position: relative;
  overflow: hidden;
}
.hero-box:hover {
  .hero-box__circle {
    width: 100%;
    height: 100%;
    transition: width 0.3s ease, border-bottom-left-radius 0.3s ease,
      border-bottom-right-radius 0.1s ease, border-top-left-radius 0.1s ease,
      border-top-right-radius 0.1s ease;
    top: 0;
    right: 0;
    border-top-left-radius: 0;
    border-top-right-radius: 0;
    border-bottom-right-radius: 0;
    border-bottom-left-radius: 0;
    // transform-origin:center;

    &:after {
      transform: scale(1);
      transition: 0.2s ease;
      transition-delay: 0.1s;
    }
    &:before {
      transition: 0.2s ease;
      transition-delay: 0.1s;
      // opacity:.3;
      right: 100px;
      top: 100px;
    }
  }

  .hero-box__body {
    color: rgb(230, 230, 230);
    transition: 0.15s ease;
    transition-delay: 0.15s;
  }
  .hero-box__title {
    color: rgb(255, 255, 255);
    transition: 0.1s ease;
    transition-delay: 0.15s;
  }
}
.hero-box__title {
  font-weight: 600;
  position: relative;
  color: #091517;
}

.hero-box__body {
  font-size: 14px;
  color: rgb(150, 150, 150);
  position: relative;
}

.hero-box__circle {
  width: 50px;
  height: 50px;
  background: rgb(200, 200, 200);
  border-top-left-radius: 100rem;
  border-top-right-radius: 100rem;
  border-bottom-right-radius: 100rem;
  border-bottom-left-radius: 100rem;
  position: absolute;
  display: block;
  right: 50px;
  top: 50px;
  transition: width 0.15s ease, height 0.15s ease,
    border-bottom-left-radius 0.3s ease, border-bottom-right-radius 0.3s ease,
    border-top-left-radius 0.3s ease, border-top-right-radius 0.3s ease;

  &:after {
    width: 300px;
    height: 300px;
    position: absolute;
    top: -100px;
    right: -100px;
    background: rgba(255, 255, 255, 0.2);
    content: "";
    border-radius: 100rem;
    transform: scale(0);
  }
  &:before {
    width: 25px;
    height: 25px;
    opacity: 0;
    position: absolute;
    content: "";
    top: 0;
    right: 0;
    background-image: url(data:image/svg+xml;base64,);
    background-size: cover;
    transition: 0.5s ease;
  }
}

.hero-box__circle--green {
  background-color: #00c569;
}
.hero-box__circle--blue {
  background-color: #0011c6;
}
.hero-box__circle--orange {
  background-color: #fd7d02;
}

header {
  display: flex;
  margin: 0 50px;
  align-items: center;
  padding: 10px 0;
  justify-content: space-between;
  position: relative;
  z-index: 2;
}
.header-branding,
.header-links {
  display: inherit;
  align-items: center;
}
.header-branding__title {
  color: #161f75;
  margin-right: 60px;
}
.header-branding__link {
  color: #091517;
  text-decoration: none;
  padding: 15px 30px;
  font-weight: 600;
  border-radius: 100rem;
  background: rgb(240, 240, 240);
}

.header-links__anchor {
  text-decoration: none;
  font-size: 15px;
  color: #091517;
  margin-right: 40px;
}
.header-links__cart {
  color: #091517;
}

.header-links__menu {
  border-radius: 0;
  border: 0;
  background: #091517;
  height: 2px;
  width: 20px;
  font-size: 0;
  position: relative;
  margin: 0 0 5px 20px;
  cursor: pointer;

  &:after,
  &:before {
    width: inherit;
    height: inherit;
    background: inherit;
    position: absolute;
    content: "";
    left: 0;
  }
  &:after {
    top: -5px;
  }
  &:before {
    top: 5px;
  }
}

.hero-content {
  margin: 0 50px;
  height: 600px;
  display: flex;
  align-items: flex-start;
  padding: 2rem 0;
  position: relative;
  z-index: 2;
}
.hero-content__title {
  @include fluid-type(35px,50px);
  color: #091517;
  max-width: 50%;
}
.hero-content__links {
  position: absolute;
  bottom: 20px;
  width: 100%;
  display: flex;
  justify-content: space-between;
  ul li {
    list-style: none;
    display: inline-block;
  }
  a {
    text-decoration: none;
    color: #091517;
    font-size: 14px;
    margin: 0 20px;
  }
}
.hero-content__links__ul--light {
  li a {
    color: rgb(150, 150, 150);
  }
}

@media only screen and (max-width: 1000px) {
  .hero-box-container {
    flex-wrap: wrap;
  }
  .hero-box {
    flex-basis: 50%;
    &:last-of-type {
      flex-basis: 100%;
    }
  }
  .hero-content {
    height: 325px;
    flex-wrap: wrap;
  }
  .hero-content__title {
    max-width: 100%;
  }

  .hero-content__links a {
    padding: 10px 15px;
